        // Rabin-Karp 
        // 执行用时：560 ms, 在所有 C# 提交中击败了7.69%的用户
        public string Check(string s, int len)
        {
            Dictionary<int, int> dic = new();
            Dictionary<int, List<string>> dups = new(); // MOD值产生重复，需要进一步判断
            ModInt mi = new(74051149);
            mi.Add(s[0] - 94);
            for (int i = 1; i < len; ++i)
            {
                mi.Multi(29);
                mi.Add(s[i] - 94);
            }
            dic[mi.Value] = 0;

            for (int i = 1, j = len; j < s.Length; ++i, ++j)
            {
                ModInt rm = new(74051149);
                rm.Add(s[i - 1] - 94);
                rm.MultiPow(29L, len - 1);
                mi.Sub(rm.Value);
                mi.Multi(29);
                mi.Add(s[j] - 94);
                //ModInt rm = new(74051149);
                //rm.Add(s[i - 1] - 94);
                //rm.Multi(MathEX.PowerMod(29, len - 1, 74051149));
                //mi.Sub(rm.Value);
                //mi.Multi(29);
                //mi.Add(s[j] - 94);

                if (dic.ContainsKey(mi.Value))
                {
                    var si = s.Substring(i, len);
                    if (dups.ContainsKey(mi.Value))
                    {
                        foreach (var s0 in dups[mi.Value])
                            if (s0 == si)
                                return si;
                        dups[mi.Value].Add(si);
                    }
                    else
                    {
                        var s0 = s.Substring(dic[mi.Value], len);
                        if (s0 == si) return si;
                        List<string> li = new() { s0, si };
                        dups[mi.Value] = li;
                    }
                }
                else
                    dic[mi.Value] = i;
            }
            return null;
        }


        public string LongestDupSubstring(string s)
        {
            int l = 0, r = s.Length - 1;
            string ans = null;
            while (l < r)
            {
                int len = l + r + 1 >> 1;
#if _DEBUG
                string checkStr = Check_BruteForce(s, len);
#else
                string checkStr = Check(s, len);
#endif
                Console.WriteLine("Check({0})='{1}'", len, checkStr == null ? -1 : checkStr.Length); // DEBUG
                if (checkStr != null)
                {
                    l = len;
                    ans = checkStr;
                }
                else
                    r = len - 1;
            }
            return ans ?? Check(s, l);
        }


