        // ver 2 // 4个用例总共10625ms
        // 优化了很多，从65s到3.8s，但放到leetcode还是超时
        public string LongestDupSubstring_ver2(string s)
        {
            int maxlen = 0, m_start = 0;
            int[] arr = new int[s.Length + 1]; int count;
            for (int start = 0, len = 0; start + len <= s.Length; start++)
            {
                count = 0;
                for (int i = start + 1; i < s.Length; ++i)
                {
                    int j = count - 1;
                    if (i + len <= s.Length && s[i] == s[start])
                    {
                        arr[count++] = i;
                        if (len == 0)
                        {
                            maxlen = len = 1;
                            m_start = start;
                        }
                    }
                    else if (i + len > s.Length && count == 0) break;
                    for (; j >= 0; --j)
                    {
                        int inc = i - arr[j];
                        if (s[i] != s[start + inc])
                            arr[j] = arr[count-- - 1];
                        else if (inc >= len)
                        {
                            maxlen = len = inc + 1;
                            m_start = start;
                        }
                    }
                }
            }

            return s.Substring(m_start, maxlen);
        }

